import React from 'react';


const ActivityList = ({ activity }) => {
    return (
        <ul id="Class-List style-none">
            {
                activity.map((performed) => (
                    <li key={performed.id}>`the Activity completed is {performed.activityName} the date this activity was completed was on {performed.activityDate}`</li>
                ))}
        </ul>
    )
}


export default ActivityList;
